[1879052485] = {["ID"] = 1879052485; ["i"] = 5; ["j"] = 1; ["k"] = 386; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 162; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "A Shot in the Dark"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. This journal was written by a hunter who seems to have spent much of his time alone somewhere on the western borders of Mirkwood across the Misty Mountains, where few Men live and goblins present a frequent threat. With no allies to rely upon and always outnumbered, he discovered the value of uncertainty and fear as a weapon to keep his pursuers off balance as he strove to survive in that rugged country. Having no-one to talk to, it seems that he chose to create a record of his life and experiences. This journal is badly weathered and torn -- perhaps by the self-same goblins whom the hunter claims to have frequently out-witted -- and several key passages are missing. Another hunter of renown might be able to shed some light on this unusual book. Legolas of Mirkwood is said to be in Eriador on a mission of some import."; ["SUMMARY"] = "Buy A Shot in the Dark from a Hunter Trainer and find the missing pages (8)"; };
[1879052486] = {["ID"] = 1879052486; ["i"] = 5; ["j"] = 1; ["k"] = 388; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 162; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "The Way of the Hunter"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. You have heard of this book before -- The Way of the Hunter is believed to have been a work produced by Elven hunters who were set to the task of guarding the approaches of the hidden city of Gondolin, which fell to the forces of darkness in the First Age. While this work outlived its authors and has been copied innumerable times since, many of those copies were produced by Men from far older works and are imperfect in their translation, leaving several important points untold. This copy of The Way of the Hunter appears to have been a much more accurate work, probably transcribed by Elven scribes in Rivendell or Lórien -- but unfortunately someone seems to have intentionally defaced the book, ripping several pages from it. Legolas of the Elves might be able to shed some light on the text."; ["SUMMARY"] = "Buy The Way of the Hunter from a Hunter Trainer and find the missing pages (8)"; };
[1879052487] = {["ID"] = 1879052487; ["i"] = 5; ["j"] = 1; ["k"] = 387; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 162; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "The Furthest Charge"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. The Furthest Charge was written by a Captain of Gondor who fought in a misguided battle shortly before the War of the Last Alliance. In this battle, the forces of the young kingdom of Gondor found themselves pitted against a company of Elven hunters out of Lórien, both sides having been tricked into battle by a device of the Enemy, who was determined to cripple the alliance that would eventually result in his overthrow. In this book, the Captain describes a valiant but doomed charge of the Men of Gondor against the Elves, within which they suffered a terrible onslaught of arrows raining down from the sky in such fashion as to cause brave men to cower and falter in their advance, trapped unmoving beneath an endless hail of biting wood and metal. The Furthest Charge is considered to be a defining work on the power of the hunter's art in the grand battles that have defined the face of Middle-earth today. Unfortunately, this copy is badly damaged by time and wear. Perhaps Legolas of Mirkwood, purported to be in Eriador, could shed some light upon the text."; ["SUMMARY"] = "Buy The Furthest Charge from a Hunter Trainer and find the missing pages (8)"; };
[1879053012] = {["ID"] = 1879053012; ["i"] = 5; ["j"] = 1; ["k"] = 372; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 24; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "The Candle's Flame"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. The Candle's Flame is a stirring piece written by one of the great Captains of Gondor during the War of the Last Alliance. It speaks of the very personal connexion that a worthy captain forms with his followers, and the power that bond can have when a fallen warrior lies upon the threshold of Death's door. Few copies of this book exist today, most having been lost in the long years since or secreted away in the hidden libraries of the Lords of Gondor. This copy of The Candle's Flame is missing many important pages. Rumour tells that Boromir, a Captain of Gondor, has come north. Perhaps he can help you comprehend the broken knowledge of this book."; ["SUMMARY"] = "Buy The Candle's Flame from a Captain Trainer and find the missing pages (8)"; };
[1879053013] = {["ID"] = 1879053013; ["i"] = 5; ["j"] = 1; ["k"] = 373; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 24; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "The Treatise of Valour"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. The Treatise of Valour was written by a council of captains who once commanded the great fortresses of the ancient kingdom of Arnor during the height of its power. It was said to have been the foundation stone of the principles of leadership and warfare for the warriors of Arnor and offered knowledge and teaching that proved key to staving off the assaults of Angmar for so long as the North Kingdom stood. All the remaining copies of the Treatise were believed lost or burned in the Sack of Fornost. Many pages of this book, The Treatise of Valour, have been torn or burned, rendering the volume nearly unreadable. Perhaps Boromir of Gondor, recently come north, will know something about it."; ["SUMMARY"] = "Buy Treatise of Valour from a Captain Trainer and find the missing pages (8)"; };
[1879053014] = {["ID"] = 1879053014; ["i"] = 5; ["j"] = 1; ["k"] = 371; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 24; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "The Book of Oaths"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. The Book of Oaths discusses the central role of Honour in true leadership and the sanctity of a King's Oath -- or a Captain's. Much of the power to guide men truly derives from the simple bond of Truth itself, and for those who lead, an Oath is a bond of commitment that cannot be broken without inviting a fate most dire. Indeed, a captain who would betray his own word risks more than his life, for it is well-known that an Oath fatefully taken binds far more than the flesh. This book is said to be the utmost authority in such matters, but the copy you have found seems badly damaged and many important passages are missing. Perhaps Boromir of Gondor, who currently rides here in the north, may know something about this book."; ["SUMMARY"] = "Buy The Book of Oaths from a Captain Trainer and find the missing pages (8)"; };
[1879059839] = {["ID"] = 1879059839; ["i"] = 5; ["j"] = 1; ["k"] = 378; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 172; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "The Tome of Swords"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. Written in a neatly defined Sindarin script, The Tome of Swords has long been renowned as one of the finest manuals on the art of swordsmanship and battle. Originally written in the early ages of Middle-earth, many copies exist -- but sometime shortly after the end of the Second Age, most of them either vanished or had important passages edited, meaning that most of the copies that exist today are incomplete. The copy you have found appears to be mostly intact, but time and wear have done the duty of whomever wished to limit the knowledge contained therein. There are a few pages that are either missing or too badly weathered to read. Perhaps the dwarf Gimli, son of Glóin of the Lonely Mountain, could tell you more about this ancient tome."; ["SUMMARY"] = "Buy The Tome of Swords from a Champion Trainer and find the missing pages (8)"; };
[1879059840] = {["ID"] = 1879059840; ["i"] = 5; ["j"] = 1; ["k"] = 377; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 172; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "The Joy of Battle"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. The Joy of Battle is an aptly named text, written by a great dwarf-champion during the height of Durin's reign in Khazad-dûm. It is no simple treatise on the art of battle, as so many texts are. Rather, it is a philosophical tract that describes the author's outlook upon warfare and battle, and how he came eventually to seek it out as a meditative and even transcendant experience that he was unable to experience in any other setting save the midst of clashing blades and the cries of battle. It is not a text for the faint-hearted or the meek, but it seems oddly lofty and its tone does not reflect the maddened bloodlust that one might have expected given the title. Alas, the long years have been rough on your copy, and there are a number of pages torn or missing from it. Gimli the Dwarf might have some insight into the missing knowledge of The Joy of Battle, since it was written by one of his forebears in the depths of time."; ["SUMMARY"] = "Buy The Joy of Battle from a Champion Trainer and find the missing pages (8)"; };
[1879059841] = {["ID"] = 1879059841; ["i"] = 5; ["j"] = 1; ["k"] = 376; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 172; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "The Artisan Blade"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. Given the title, you half expected that this book would have been written by an Elf -- and indeed the script is Sindarin -- but it seems that the author is a champion of some ancient Númenórean lineage from a time before the founding of Arnor. The text is so ancient that some of the pages threaten to crumble in your hands as you carefully peruse it. While the dialect is ancient and difficult to read, the author's approach to swordsmanship is rather unusual, placing a great deal of emphasis on grueling repetition and concentration around what appear to be the most basic motions of the form. It suggests a focus on absolute control and power, which then leads to the discovery of finesse and artistry. If only several key passages and pages were not missing, it could be an invaluable training guide -- perhaps Gimli the Dwarf could tell you more?"; ["SUMMARY"] = "Buy The Artisan Blade from a Champion Trainer and find the missing pages (8)"; };
[1879060151] = {["ID"] = 1879060151; ["i"] = 5; ["j"] = 1; ["k"] = 382; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 23; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "The Best Defence"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. This book was written as a primer in the Guardian's art some time in the middle of the Third Age, during the difficult period after the fall of Khazad-dûm. At that time, Durin's Folk were scattered and greatly reduced in number, and the Guardian's role took on a much greater importance as the threat of goblins and Orcs to dwarf-settlements beneath the roots of the world became more and more common. The dwarves often settled for building powerful strongholds designed to make the approach to their cities, impervious to assault, manning them with skilled and powerful guardians to ensure that none would pass unchallenged. While the book itself is common enough, the owner of this copy seems to have scribbled copious notes within the margins of the pages -- notes containing an experience and insight to the art that even at a glance exceeds that of the original author. Unfortunately, the copy is worn and tattered, and a number of pages are missing. Perhaps someone well-versed in the art could provide you with some insight as to the identity of the mysterious scribbler and where his remaining notes could be found?"; ["SUMMARY"] = "Buy The Best Defence from a Guardian Trainer and find the missing pages (8)"; };
[1879060152] = {["ID"] = 1879060152; ["i"] = 5; ["j"] = 1; ["k"] = 381; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 23; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "A Shield-maiden's Song"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. A Shield-maiden's Song was written many long years ago and tells the tale of a Shield-maiden of Rohan. While the Shield-maidens of Rohan were rarely called to war, they were nevertheless as well-trained and versed in the arts of battle as their male counterparts. This book tells the tale of one such Maiden caught in unexpected battle, who in striving to defend her Lord against a great onslaught, sang out in clearest tones a stirring song of war as she fought. Such was the power of her voice that even the Orcs whom she faced saw her not as a frail woman, but as a great warrior to be feared. Alas, you have no idea how the story ends and several other details beside seem to be missing from this copy of the book, which has been damaged by time and neglect. Perhaps there is someone at Rivendell who would be able to make use of it."; ["SUMMARY"] = "Buy A Shield-maiden's Song from a Guardian Trainer and find the missing pages (8)"; };
[1879060153] = {["ID"] = 1879060153; ["i"] = 5; ["j"] = 1; ["k"] = 383; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 23; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "The Final Word"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. This book is of Elvish origin, having been written so long ago that few of the Elves today were alive at the time of its writing. You cannot even guess at how old it actually is, as it seems to show few signs of age or decay. You cannot recognize the type of parchment it was written upon, nor what kind of ink could withstand the passage of so much time without fading. The main indication of its age and origin is the writing style which is in an extremely old form using ancient letters called Tengwar, which were created by the Noldor many ages ago. The main focus of the book is difficult to translate, but seems to centre around an ancient oath of battle that Elf-guardians might make in the midst of a desperate melee, in essence binding themselves and their enemies in a pact of battle and death that neither the oath-taker nor their sworn-enemies dared break. It is clear from the text that these oaths carried power beyond that of any simple cry to infuriate or trick one's enemies -- but the secret of the technique seems lost as several key pages have been carefully cut from the book, presumably by someone hoping to safe-guard its secrets in an age long past. Perhaps someone in Rivendell will be able to help decipher the book."; ["SUMMARY"] = "Buy The Final Word from a Guardian Trainer and find the missing pages (8)"; };
