[1879458029] = {["ID"] = 1879458029; ["i"] = 5; ["j"] = 1; ["k"] = 397; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 216; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "The Shanty-singer's Compendium"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. The Shanty-singer's Compendium appears to have been penned by several different and very opinionated authors over a number of years—or perhaps centuries. This particular copy is heavily annotated, with a previous reader's thoughts scribbled into its margins. Several passages have been struck through entirely, and you notice that several shanties have been rearranged, replacing mentions of Umbar with Bree-town. Even so, it provides a thorough history of sea-shanties and contains a collection of songs sung by sailors and Mariners of Gondor and Umbar."; };
