[1879458042] = {["ID"] = 1879458042; ["i"] = 5; ["j"] = 1; ["k"] = 398; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 216; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "A Guiding Star"; ["LORE"] = "The first four pages of this book can be found on enemies scattered across Angmar, Eregion, and Moria. The last four pages of this book can be found on enemies scattered across Forochel, Moria, and the Misty Mountains. It is purported that A Guiding Star was penned by Círdan the Shipwright, Master of the Grey Havens, but this claim has often been disputed. It seems many readers insist that it is not written in the mode of the Elves—though curiously such criticisms have not often come from Elves—but much praise has been given to the included sketches and diagrams that attempt to map the stars of Middle-earth. Regardless of its true authorship, this book contains a wealth of knowledge about the positions of stars, constellations, and how they might be used as guides for navigation upon the Sea."; };
