[1879468428] = {["ID"] = 1879468428; ["i"] = 8; ["j"] = 10; ["k"] = 1; ["TYPE"] = 7; ["VXP"] = 4000; ["MIN_LVL"] = 133; ["NAME"] = "Deeds of Outer Gondor"; ["LORE"] = "In the aftermath of the War of the Ring, the peoples of Anfalas and Pinnath Gelin mourn the loss of their Lords while struggling against the Corsairs of Umbar and other foes to restore a long-absent peace in Outer Gondor."; ["TITLE"] = "Renewer of Outer Gondor"; };
[1879468651] = {["ID"] = 1879468651; ["i"] = 5; ["j"] = 2; ["k"] = 55; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 5; ["MIN_LVL"] = 13; ["NAME"] = "Enmity of the Wolves"; ["LORE"] = "Wolves have long been a scourge of the peaceful River Hobbits of Misthallow. In hard winters, they often stalk the Wells of Langflood—and the Vales of Anduin to the south—to prey upon livestock and to threaten the River Hobbits themselves in vicious packs. Nowadays, though, one must wonder, for they have strayed from the North in larger and larger packs, and they seem more than just hungry—there are rumours that many of these packs were bred by some new evil to be particularly vicious, to prey upon the unwary and the meek, and to sniff out those who would mean to hide from the eyes of the Enemy."; };
[1879468653] = {["ID"] = 1879468653; ["i"] = 5; ["j"] = 2; ["k"] = 54; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 10; ["MIN_LVL"] = 19; ["NAME"] = "Enmity of the Wolves II"; ["LORE"] = "The tales of old speak of goblins, bats, and Wargs loyal to an ancient Orc-lord who ruled Mount Gundabad. It is said that his wickedness was so great that it drew all manner of foul creatures to the surrounding lands, not the least of which are the vicious wolves that have long troubled the River Hobbits of Misthallow. Has such a thing come to pass yet again? Do new evils stir in the North? Whatever the truth of it, it seems an ill omen that now wolves can be found across nearly all of Middle-earth."; };
[1879468656] = {["ID"] = 1879468656; ["i"] = 5; ["j"] = 2; ["k"] = 57; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 5; ["MIN_LVL"] = 19; ["NAME"] = "Enmity of the Wood-trolls"; ["LORE"] = "Long ago, the River Hobbits of Misthallow first encountered the wood-demons of Mirkwood and tales of these terrible creatures passed into legend. Among the Elves, they are called wood-trolls, and it is said that their gnarled limbs drip with a deadly poison—one so terrible that it can rot a forest from within."; };
[1879468657] = {["ID"] = 1879468657; ["i"] = 5; ["j"] = 2; ["k"] = 56; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 10; ["MIN_LVL"] = 25; ["NAME"] = "Enmity of the Wood-trolls II"; ["LORE"] = "Many are the tales of the wood-demons of the North, who spread like a festering disease through the Greenwood of old. Rumours tell that others alike to their kind have appeared in lands far beyond the bounds of Mirkwood and the Wells of Langflood, and many among the River Hobbits of Misthallow now believe that nature itself is being corrupted by some unseen hand."; };
[1879468717] = {["ID"] = 1879468717; ["i"] = 5; ["j"] = 2; ["k"] = 58; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 15; ["MIN_LVL"] = 30; ["NAME"] = "Enmity of the Orcs and Goblins III"; ["LORE"] = "While Orcs dislike the sun nearly as much as their lesser brethren, the goblins, they have more tolerance for it and can be forced to endure it for a time when necessity—or the lash of their masters—demands. Despite this, the River Hobbits of Misthallow know all too well that Orcs and goblins of the North often stalk the mists that linger upon the Wells of Langflood."; };
[1879468718] = {["ID"] = 1879468718; ["i"] = 5; ["j"] = 2; ["k"] = 59; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 10; ["MIN_LVL"] = 25; ["NAME"] = "Enmity of the Orcs and Goblins II"; ["LORE"] = "Orcs and goblins are neither cowards nor weaklings, but their oft-unfocused strength and determination is of little use against a foe they cannot find—or a foe they cannot even be certain truly exists! Legends and stories persist among them of the River Hobbits of Misthallow, but there is little time to speak of such trifles in the service of the Enemy."; };
[1879468719] = {["ID"] = 1879468719; ["i"] = 5; ["j"] = 2; ["k"] = 60; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 5; ["MIN_LVL"] = 19; ["NAME"] = "Enmity of the Orcs and Goblins"; ["LORE"] = "Bred by the Enemy for war over land, the Orcs are larger and tougher than their goblin cousins, but their origins remain the same, and to the River Hobbits of Misthallow, there is little distinction between them. Militant and brutish, Orcs and goblins retain some native talent for the clever working of wood and metal, though they only apply this to the construction of weapons and other machines of war."; };
[1879468766] = {["ID"] = 1879468766; ["i"] = 5; ["j"] = 2; ["k"] = 61; ["TYPE"] = 7; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 5; ["MIN_LVL"] = 25; ["NAME"] = "Friend of the Forsaken"; ["LORE"] = "You have become a friend to the Eglain—Men who have shunned accepted society, choosing the meagre life that the Lone-lands will support. Although they dwell in less-hospitable lands than the Wells of Langflood, their way of life and their friendship with Radagast the Brown has led you to consider them kindred spirits of the River Hobbits of Misthallow."; ["TITLE"] = "Rill-runner"; };
[1879468771] = {["ID"] = 1879468771; ["i"] = 5; ["j"] = 2; ["k"] = 62; ["TYPE"] = 6; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 10; ["MIN_LVL"] = 125; ["NAME"] = "Back And There Again"; ["LORE"] = "Few among the River Hobbits have journeyed as far from home as you, but even after all your adventures, there are few things that would bring you more comfort than returning to Misthallow."; ["TITLE"] = "Current-rider"; };
